import React from "react";

const Filter = () => {
  return (
    <>
      <img
        style={{
          aspectRatio: "3/4",
          width: "10%",
          mixBlendMode: "darken",
          filter: "brightness(0.5)",
        }}
        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSOhuy_XTB3n4ZjpKxU-hWI8wNowxh9m8W4fA&s"
        alt=""
      />
      <div>
        <label class="container1">
          <input checked="checked" type="checkbox" />
          <div class="checkmark"></div>
        </label>
      </div>
    </>
  );
};

export default Filter;
